import { createRouter, createWebHistory } from 'vue-router'
import Start from "../components/Start";
import Timetable from "../components/Timetable";
import { startData, timetable3Data } from "../data";


const routes = [
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
      path: "/",
      component: Start,
      props: {
        timetableProps: startData.timetableProps,
        userInfoBoxProps: startData.userInfoBoxProps,
        xMenuProps: startData.xMenuProps,
      },
    },
    {
      path: "/timetable",
      component: Timetable,
      props: {
        timeline1Props: timetable3Data.timeline1Props,
        timeline2Props: timetable3Data.timeline2Props,
        timeline3Props: timetable3Data.timeline3Props,
        timeline4Props: timetable3Data.timeline4Props,
        timeline5Props: timetable3Data.timeline5Props,
        timeline6Props: timetable3Data.timeline6Props,
      },
    },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
